Fraction of frame area: 0.334
```


:::
:::

use plot to examine the correctness of the output object

::: {.cell}

```{.r .cell-code}
plot(fire_month_owin)
```

::: {.cell-output-display}
![](Hands-on_Ex04_files/figure-html/unnamed-chunk-14-1.png){width=672}
:::
:::

## 4.4 Computing Spatio-temporal KDE
compute the STKDE

::: {.cell}

```{.r .cell-code}
st_kde <- spattemp.density(fire_month_owin)
```

::: {.cell-output .cell-output-stderr}

```
Calculating trivariate smooth...Done.
Edge-correcting...Done.
Conditioning on time...Done.
```


:::

```{.r .cell-code}
summary(st_kde)
```

::: {.cell-output .cell-output-stdout}

```
Spatiotemporal Kernel Density Estimate

Bandwidths
  h = 15102.47 (spatial)
  lambda = 0.0304 (temporal)

No. of observations
  741 

Spatial bound
  Type: polygonal
  2D enclosure: [512066.8, 705559.4] x [9655398, 9834006]

Temporal bound
  [1, 12]

Evaluation
  128 x 128 x 12 trivariate lattice
  Density range: [1.233458e-27, 8.202976e-10]
```


:::
:::

## 4.5 Plotting the spatio-temporal KDE object

::: {.cell}

```{.r .cell-code}
tims <- c(7,8,9,10,11,12)
par(mfcol= c(2,3))
for(i in tims){
  plot(st_kde,i,override.par=FALSE,fix.range=TRUE,main=paste("KDE AT MONTH",i))
}
```

::: {.cell-output-display}
![](Hands-on_Ex04_files/figure-html/unnamed-chunk-16-1.png){width=672}
:::
:::

# 5.0 Computing STKDE by Day of Year
## 5.1 Creating ppp object
DayofYear field is included in the output ppp object

::: {.cell}

```{.r .cell-code}
fire_yday_ppp <- fire_sf%>%
  select(DayofYear)%>%
  as.ppp()
```
:::

## 5.2 Including Owin object
combine the ppp object and the owin object

::: {.cell}

```{.r .cell-code}
fire_yday_owin <- fire_yday_ppp[kbb_owin]
summary(fire_yday_owin)
```

